BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "RaceCard" (
	"dt"	TEXT,
	"raceno"	TEXT,
	"馬匹編號"	TEXT,
	"6次近績"	TEXT,
	"馬名"	TEXT,
	"烙號"	TEXT,
	"負磅"	TEXT,
	"騎師"	TEXT,
	"可能超磅"	TEXT,
	"檔位"	TEXT,
	"練馬師"	TEXT,
	"國際評分"	TEXT,
	"評分"	TEXT,
	"評分+/-"	TEXT,
	"排位體重"	TEXT,
	"排位體重+/-"	TEXT,
	"最佳時間"	TEXT,
	"馬齡"	TEXT,
	"分齡讓磅"	TEXT,
	"性別"	TEXT,
	"今季獎金"	TEXT,
	"優先參賽次序"	TEXT,
	"配備"	TEXT,
	"馬主"	TEXT,
	"父系"	TEXT,
	"母系"	TEXT,
	"進口類別"	TEXT,
	PRIMARY KEY("dt","raceno","騎師")
);
CREATE TABLE IF NOT EXISTS "LocalResults" (
	"名次"	TEXT,
	"馬號"	TEXT,
	"馬名"	TEXT,
	"騎師"	TEXT,
	"練馬師"	TEXT,
	"實際負磅"	TEXT,
	"排位體重"	TEXT,
	"檔位"	TEXT,
	"頭馬距離"	TEXT,
	"沿途走位"	TEXT,
	"完成時間"	TEXT,
	"獨贏賠率"	TEXT,
	"dt"	TEXT,
	PRIMARY KEY("馬名","dt")
);
CREATE TABLE IF NOT EXISTS "LocalResultsComInfo" (
	"dt"	TEXT,
	"meters"	TEXT,
	PRIMARY KEY("dt")
);
COMMIT;
